import React from "react";
import './style.css'

const NavBar = (props: any) => {
    return (
        <div className="navBar">
            <div>
                <img className="burger" src="https://cdn-icons-png.flaticon.com/512/5358/5358649.png" alt="burger icon" />
            </div>
        </div>
    )
}

export default NavBar
